import React,{Fragment} from 'react';
import { BrowserRouter as Router, Route} from "react-router-dom";
import Home from './index';

const PageRouter: React.FC = () => {
    return(
        <Fragment>
             <Router>
             <Switch>
            <Route  path="/" element={<Home/>} />

          </Switch>
             </Router>
        </Fragment>
    )

}

export default PageRouter
